import React from "react";
import axios from "axios";
function ChatPage() {
  const fetchChats = () => {
    axios
      .get("/api/chat")
      .then((response) => console.log(response))
      .catch((err) => console.log(err));
  };
  return <div>CHAT</div>;
}

export default ChatPage;
